export function add18(a: number, b: number): number {
  return a + b;
}

export function subtract18(a: number, b: number): number {
  return a - b;
}

export function multiply18(a: number, b: number): number {
  return a * b;
}

export function divide18(a: number, b: number): number {
  return a / b;
}
